import React from 'react';
import './styles/Home.css';
import image97 from '../Assets/image97.png'; 
import mainBackground from '../Assets/images/Main.png';


function Home() {
  const mainContentStyle = {
    backgroundImage: `url(${mainBackground})`,
    backgroundSize: '800px 600px', // Width and height of the background image
    backgroundPosition: 'center',
    backgroundRepeat: 'no-repeat' // Ensures the background image does not tile
  };

  return (
    <div className="home">
      <div className="main-content" style={mainContentStyle}>
        <div className="text-section">
          <h1>Патоморфологическая Лаборатория</h1>
          <p>Лаборатория оснащена новейшим оборудованием по стандартам США.</p>
          <div className="buttons">
            <button className="login-btn">Войти</button>
            <button className="register-btn">Зарегистрироваться</button>
          </div>
        </div>
        <div className="image-section">
          <img src={image97} alt="Lab Equipment" />
        </div>
      </div>
    </div>
  );
}

export default Home;
